kona-common implements raw syscall dispatch, a default global memory allocator, and a blocking async runtime. kona-common relies on a minimal linux backend to function, supporting only the syscalls required to implement the PreimageOracle ABI (read, write, exit_group). These syscalls are exposed to the user through the io module directly, with each supported platform implementing the BasicKernelInterface trait. To directly dispatch these syscalls, the io module exposes a safe API: use kona_common::{io, FileDescriptor}; // Print to `stdout`. Infalliable, will panic if dispatch fails.
io::print("Hello, world!"); // Print to `stderr`. Infalliable, will panic if dispatch fails.
io::print_err("Goodbye, world!"); // Read from or write to a specified file descriptor. Returns a result with the
// return value or syscall errno.
let _ = io::write(FileDescriptor::StdOut, "Hello, world!".as_bytes());
let mut buf = Vec::with_capacity(8);
let _ = io::read(FileDescriptor::StdIn, buf.as_mut_slice()); // Exit the program with a specified exit code.
io::exit(0); With this library, you can implement a custom host<->client communication protocol, or extend the existing PreimageOracle ABI . However, for most developers, we recommend sticking with kona-preimage when developing programs that target the FPVMs , barring needs like printing directly to stdout.

