Finally, in kona-client, implementations of data source traits from kona-derive and kona-executor are implemented to pull in untyped data from the host by PreimageKey. These data source traits are covered in more detail within the Custom Backend section, but we'll quickly gloss over them here to build intuition. Let's take, for example, OracleL1ChainProvider . The ChainProvider trait in kona-derive defines a simple interface for fetching information about the L1 chain. In the OracleL1ChainProvider, this information is pulled in over the PreimageOracle ABI . There are many other examples of these data source traits, namely the L2ChainProvider, BlobProvider, TrieProvider, and TrieHinter, which enable the creation of different data-source backends. As an example, let's look at OracleL1ChainProvider::header_by_hash, built on top of the CommsClient trait, which is a composition trait of the PreimageOracleClient + HintReaderServer traits outlined above. #[async_trait]
impl<T: CommsClient + Sync + Send> ChainProvider for OracleL1ChainProvider<T> { type Error = anyhow::Error; async fn header_by_hash(&mut self, hash: B256) -> Result<Header> { // Send a hint for the block header. self.oracle.write(&HintType::L1BlockHeader.encode_with(&[hash.as_ref()])).await?; // Fetch the header RLP from the oracle. let header_rlp = self.oracle.get(PreimageKey::new(*hash, PreimageKeyType::Keccak256)).await?; // Decode the header RLP into a Header. Header::decode(&mut header_rlp.as_slice()) .map_err(|e| anyhow!("Failed to decode header RLP: {e}")) } // - snip -
} In header_by_hash, we use the inner HintWriter to send a hint to the host to prepare the block hash preimage. Then, once we've received an acknowledgement from the host that the preimage has been prepared, we reach out for the RLP (which is the preimage of the hash). After the RLP is received, we decode the Header type, and return it to the user.

